    class func drawStripedSquare(frame targetFrame: CGRect = CGRect(x: 0, y: 0, width: 400, height: 300), _ color: UIColor = #colorLiteral(red: 1.0, green: 1.0, blue: 1.0, alpha: 1.0), fill: Bool = false, resizing: ResizingBehavior = .aspectFit) {
        /// General Declarations
        let context = UIGraphicsGetCurrentContext()!
        
        /// Resize to Target Frame
        context.saveGState()
        let resizedFrame = resizing.apply(rect: CGRect(x: 0, y: 0, width: 590, height: 910), target: targetFrame)
        context.translateBy(x: resizedFrame.minX, y: resizedFrame.minY)
        context.scaleBy(x: resizedFrame.width / 590, y: resizedFrame.height / 910)
        
        /// Group
        do {
            context.saveGState()
            context.translateBy(x: 145, y: 305)
            
            /// square
            let square = UIBezierPath()
            square.move(to: CGPoint.zero)
            square.addLine(to: CGPoint(x: 300, y: 0))
            square.addLine(to: CGPoint(x: 300, y: 300))
            square.addLine(to: CGPoint(x: 0, y: 300))
            square.addLine(to: CGPoint.zero)
            square.close()
            context.saveGState()
            context.saveGState()
            square.lineWidth = 16
            context.beginPath()
            context.addPath(square.cgPath)
            context.clip(using: .evenOdd)
            color.setStroke()
            square.stroke()
            context.restoreGState()
            context.restoreGState()
            
            /// square (Outline Mask)
            context.saveGState()
            square.addClip()
            
            /// Stripes
            do {
                context.saveGState()
                context.translateBy(x: 149.57, y: 149.57)
                context.rotate(by: 315 * CGFloat.pi/180)
                context.translateBy(x: -261.5, y: -296.5)
                
                /// Line Copy 16
                let lineCopy16 = UIBezierPath()
                lineCopy16.move(to: CGPoint.zero)
                lineCopy16.addLine(to: CGPoint(x: 520.78, y: 0))
                context.saveGState()
                context.translateBy(x: 0, y: 292.99)
                lineCopy16.lineCapStyle = .square
                lineCopy16.lineWidth = 3
                color.setStroke()
